import "./App.css";
import Table from "./components/Table";

function App() {
  const data = [
    { hostname: "host1.example.com", ip: "192.168.1.1", status: "Online" },
    { hostname: "host2.example.com", ip: "192.168.1.2", status: "Offline" },
    { hostname: "host3.example.com", ip: "192.168.1.3", status: "Online" },
    { hostname: "host4.example.com", ip: "192.168.1.4", status: "Offline" },
    { hostname: "host5.example.com", ip: "192.168.1.5", status: "Online" },
  ];

  return (
    <div className="root-container">
      <div className="main-container">
        <Table data={data} />
      </div>
    </div>
  );
}

export default App;
